import React, { useState } from "react";
import Select from "react-select";
import "./App.css";

interface Card {
  id: number;
  title: string;
  content: string;
}

const generateDummyData = (num: number): Card[] => {
  const cards: Card[] = [];
  for (let i = 1; i <= num; i++) {
    cards.push({
      id: i,
      title: `Card ${i}`,
      content: `This is the content of card ${i}.`,
    });
  }
  return cards;
};

const options = [
  "Literatures, Cultures, & Ling",
  "Engineering Hall",
  "Education Building",
  "Wohlers Hall",
  "David Kinley Hall",
  "Lincoln Hall",
  "Armory",
  "Temple Hoyne Buell Hall",
