  "Loomis Laboratory",
  "Electrical & Computer Eng Bldg",
  "Materials Science & Eng Bld",
  "Music Building",
  "Spurlock Museum",
  "Ctr Wounded Veterans Higher Ed",
  "Siebel Center for Comp Sci",
  "Stock Pavilion",
  "South Farms",
  "Natural History Building",
  "Meat Science Laboratory",
  "Burrill Hall",
  "Vet Med Basic Sciences Bldg",
  "E R Madigan Laboratory",
  "FAR Meeting Space",
  "Law Building",
  "Architecture Annex",
  "Library",
  "Flagg Hall",
  "Allen Residence Hall",
  "Art and Design Building",
  "Japan House",
