  "Student Dining & Res Program",
  "Civil & Envir Eng Bldg",
  "Foellinger Auditorium",
  "901 W Oregon",
  "Illini Center",
  "Coordinated Science Lab",
  "Krannert Center for Perf Arts",
  "907 1/2 W Nevada",
  "Dance Studio",
  "Micro & Nanotechnology Lab",
  "Speech & Hearing Science Bldg",
  "Smith Memorial Hall",
  "Agricultural Bioprocess Lab",
  "Pennsylvania Lounge Bld - PAR",
  "Christopher Hall",
  "1205 W Nevada",
  "Child Development Laboratory",
  "Expanded Child Dev Lab",
  "1203 1/2 W Nevada",
  "Campus Recreation Center East",
  "Freer Hall",
  "Activities & Recreation Center",
  "Illini Union",
  "Ice Arena",
  "Plant Sciences Laboratory",
  "Grad Sch of Lib & Info Science",
  "Art-East Annex, Studio 2",
  "Richmond Studio",
  "Campbell Hall",
  "Wardall Hall - ISR",
  "Illinois Street Residence Lng",
  "Inst Labor &  Industrial Rel",
  "Mechanical Engineering Lab",
  "Seitz Materials Research Lab",
  "Outdoor Space",
  "Ceramics Kiln House",
  "Harding Band Building",
  "Beckman Institute",
  "Nuclear Radiations Laboratory",
  "Lincoln Avenue Residence Hall",
  "Engineering Sciences Building",
  "1010 W Nevada",
  "805 W Pennsylvania",
  "Veterinary Teaching Hospital",
].map((option) => ({ value: option, label: option }));

const customStyles = {
  control: (provided: any) => ({
    ...provided,
    margin: "10px 0",
  }),
  option: (provided: any, state: any) => ({
    ...provided,
    color: state.isSelected ? "white" : "black",
    backgroundColor: state.isSelected ? "#007bff" : "white",
    ":hover": {
      backgroundColor: "#f2f2f2",
    },
  }),
  singleValue: (provided: any) => ({
    ...provided,
    color: "black",
  }),
  menu: (provided: any) => ({
    ...provided,
    zIndex: 9999,
  }),
};

const App: React.FC = () => {
  const [input, setInput] = useState<string>("");
  const [cards, setCards] = useState<Card[]>([]);
  const [selectedOption, setSelectedOption] = useState<{
    value: string;
    label: string;
  } | null>(null);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setInput(e.target.value);
  };

  const handleSelectChange = (
    selectedOption: { value: string; label: string } | null
  ) => {
    setSelectedOption(selectedOption);
  };

  const generateCards = () => {
    const num = parseInt(input);
    if (!isNaN(num) && num > 0) {
      setCards(generateDummyData(num));
    } else {
      alert("Please enter a valid number greater than 0.");
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Card Generator</h1>
        <div className="input-container">
          <input
            type="text"
            value={input}
            onChange={handleInputChange}
            placeholder="Enter a number"
          />
          <button onClick={generateCards}>Generate Cards</button>
        </div>
        <div className="select-container">
          <Select
            value={selectedOption}
            onChange={handleSelectChange}
            options={options}
            styles={customStyles}
            placeholder="Select an option"
          />
        </div>
        <div className="card-container">
          {cards.map((card) => (
            <div key={card.id} className="card">
              <h2>{card.title}</h2>
              <p>{card.content}</p>
            </div>
          ))}
        </div>
      </header>
    </div>
  );
};

export default App;
